import React from 'react'
import moment from "moment";


export const IndividualData = ({individualExcelData}) =>
 {
    return (
        <>
        
            <th>{individualExcelData.Date.format('HH:mm:ss')}</th>
            <th>{individualExcelData.Text}</th>
      
        </>
    )
}
